bc903','7c7c4290-61e5-11e2-975d-5cff350bc903','2008.10.10','0811432','1、首程无病例特点；2、病程记录中上级查房对再骨折的原因无分析及对策；3、无内固定物植入知情同意书；4、预防性应用抗生素时间过长，4天；5、诊断欠确切；6、对骨折成角畸形度数无明确记录；7、手术讨论未列出手术指征。',NULL,'不合格','0','83d14380-61e7-11e2-975d-5cff350bc903'),(457,'舒诗军','621da91a-61e5-11e2-975d-5cff350bc903','7c7c4290-61e5-11e2-975d-5cff350bc903','2008.10.10','0811089','1、病例特点未写；2、9.29血常规白细胞升高，至10.10未复查血常规。',NULL,'不合格','0','83d14380-61e7-11e2-975d-5cff350bc903'),(458,'舒诗军','621da91a-61e5-11e2-975d-5cff350bc903','7c7c4290-61e5-11e2-975d-5cff350bc903','2008.10.10','0810779','合格。',NULL,'合格','0','83d14380-61e7-11e2-975d-5cff350bc903'),(459,'邓玉林','621da91a-61e5-11e2-975d-5cff350bc903','7c7c2900-61e5-11e2-975d-5cff350bc903','2008.10.10','0811591','1、首程未注明“病例特点”；2、鉴别诊断缺乏针对性；3、喘息性支气管炎没有与支气管哮喘鉴别；4、病历存在拷贝现象；5、应用丹参促进啰音吸收是否合理。',NULL,'不合格','0','83ced975-61e7-11e2-975d-5cff350bc903'),(460,'黄   教','621da91a-61e5-11e2-975d-5cff350bc903','7c7c2900-61e5-11e2-975d-5cff350bc903','2008.10.10','0811516','1、诊断依据少CRP支持；2、诊疗计划抗病毒少写利巴韦林用药；3、临时医嘱中枯草杆菌二联活菌颗粒写6g×10包，不规范；4、治疗5天，改护理级别，未复查血常规、CRP；5、住院证住址未写。',NULL,'不合格','0','83ced975-61e7-11e2-975d-5cff350bc903'),(461,'黄   教','621da91a-61e5-11e2-975d-5cff350bc903','7c7c2900-61e5-11e2-975d-5cff350bc903','2008.10.10','0811626','1、该患儿10个月大，诊断为婴幼儿腹泻并脱水，体检中少头颅前后囟情况；2、诊断为婴幼儿腹泻并轻度脱水，不确切，应为“婴儿腹泻并中度脱水”，诊断依据“口唇粘膜干燥，双眼眶凹陷，少尿”；3、上级医师查房分析过简，如腹泻病因，发病机制，并发症等。',NULL,'不合格','0','83ced975-61e7-11e2-975d-5cff350bc903'),(462,'邓玉林','621da91a-61e5-11e2-975d-5cff350bc903','7c7c2900-61e5-11e2-975d-5cff350bc903','2008.10.10','0811605','1、首程中现病史描述前后矛盾（前写少许口吐白沫，后写口吐白沫无明显好转）；2、首程中阴性症状描述简单；3、主诉重点不准确（应写误吸入多长时间，而写口吐白沫半小时）；4、诊断依据不精练；5、为什么要洗胃、使用VitK、多巴胺？',NULL,'不合格','0','83ced975-61e7-11e2-975d-5cff350bc903'),(463,'朱冰封','621da91a-61e5-11e2-975d-5cff350bc903','7c7c2900-61e5-11e2-975d-5cff350bc903','2008.10.10','0811455','1、病程中苯巴比妥是酶诱导剂，其作用机制不是减少肝肠循环；2、新生儿重度窒息，应用纳洛酮疗程3-5天，病程7天未停用；3、入院时二氧化碳结合力异常未复查。',NULL,'不合格','0','83ced975-61e7-11e2-975d-5cff350bc903'),(464,'黄献来','621da91a-61e5-11e2-975d-5cff350bc903','7c7c2