8入院血压210/100mmHg，直到10.3病程中才出现血压160/90mmHg，期间改过降压药，未分析记录。',NULL,'不合格','0','83cedff3-61e7-11e2-975d-5cff350bc903'),(473,'刘汉桃','621da91a-61e5-11e2-975d-5cff350bc903','7c7c2a0f-61e5-11e2-975d-5cff350bc903','2008.10.10','0811280','1、现病史中未描述门诊诊疗情况；2、入院诊断未及时补充；3、电解质异常未分析；3、体格检查不完整；4、报告粘贴单患者姓名住院号未填。',NULL,'不合格','0','83cedff3-61e7-11e2-975d-5cff350bc903'),(474,'付保忠','621da91a-61e5-11e2-975d-5cff350bc903','7c7c2b12-61e5-11e2-975d-5cff350bc903','2008.10.10','0810991','1、升结肠癌患者诊疗计划中是否需要提及“手术问题”；2、“病史特点”应为“病例特点”；3、有输血病程中无记录；4、医患协议书：谈话医师未签名，一般项目填写不全；5、医嘱书写行空格不统一；6、首页未填写；7、奥美拉唑未写剂型；8、血红蛋白56.09/L，入院病历诊断失血性贫血（重度），病程诊断为中度；9、住院证经办人、患者或家属未签名；10、吸氧无流量。',NULL,'不合格','0','83cee87a-61e7-11e2-975d-5cff350bc903'),(475,'赖松银','621da91a-61e5-11e2-975d-5cff350bc903','7c7c2b12-61e5-11e2-975d-5cff350bc903','2008.10.10','0811567','1、病史中血糖8.12mmol/L未注明在何种情况下所测，也未分析；2、B超示：肝囊肿，异性上腹部CT及CEA、AFP检查，但未定期复查；3、医嘱书写主次不分明。',NULL,'不合格','0','83cee87a-61e7-11e2-975d-5cff350bc903'),(476,'鲁   威','621da91a-61e5-11e2-975d-5cff350bc903','7c7c2b12-61e5-11e2-975d-5cff350bc903','2008.10.10','0811464','1、首程中病史特点描述欠简洁，重点欠突出，如大量饮酒后出现上腹部持续性疼痛，查体脐周有压痛，血液淀粉酶明显增高，血象高，有低脂血症等；2、首程中鉴别诊断未与急性胃炎、急性心梗相鉴别；3、诊疗计划不详细，禁食还要禁饮；4、各级医师查房欠缺对急性胰腺炎病情程度的分析、描述，鉴别诊断未与胃及心脏疾病鉴别；5、对实验室检查结果的分析无记录或无分析，如低脂血症等；6、两年前已诊断为急性胰腺炎，此次入院应诊断为慢性胰腺炎急性发作。',NULL,'不合格','0','83cee87a-61e7-11e2-975d-5cff350bc903'),(477,'鲁   威','621da91a-61e5-11e2-975d-5cff350bc903','7c7c2b12-61e5-11e2-975d-5cff350bc903','2008.10.10','0811547','1、首程中未考虑胸背部疼痛的鉴别诊断；2、尿常规见隐血，考虑标本污染（标本污染有血还是白细胞？）；3、胸片：病历中未描述骨折结果；4、入院诊断不全（高脂血症、骨折）；5、疼痛症状在10.8、10.9的病程记录中未描述。',NULL,'不合格','0','83cee87a-61e7-11e2-975d-5cff350bc903'),(478,'鲁   威','621da91a-61e5-11e2-975d-5cff350bc903','7c7c2b12-61e5-11e2-975d-5cff350bc903','2008.10.10','0811554','1、眼科会诊意见病程未体现，缺会诊诊断分析；2、10.8医嘱中请康复科会诊，但无会诊记录及会诊记录单；3、病程存在拷贝现象；4、医患协议书未签名；5、病案首页空白。',NULL,'不合格','0','83cee87a-61e7-11e2-975d-5cff350bc903'),(479,'洪海填','621da91a-61e5-11e2-975d-5cff350bc903','7c7c3d46-61e5-11e2-975d-5cff350bc903','2008.10.10','0811580','1、病史特点不明显；2、医师签名潦草难辨。'